const polybench_slow = "";
const polybench_fast = "";

class WasmBenchmark {
    constructor(base64str) {
        this.base64str = base64str;
        this.wasm = null;
        this.linear_mem_start = 0;
        this.pages_allocated = 0;
    }

    async init() {
        try {
            if (this.wasm === null) {
                const imports = {};
                const buffer = Uint8Array.from(atob(this.base64str), c => c.charCodeAt(0));
                const result = await WebAssembly.instantiate(buffer, imports);
                this.wasm = result.instance.exports;
                this.linear_mem_start = this.wasm.memory.buffer.byteLength;
            }
        } catch (e) {
            if (e instanceof WebAssembly.CompileError) {
                this.simdErrorAlert();
            }
            throw e;
        }
    }

    simdErrorAlert() {
        alert("This needs WebAssembly SIMD support. Enable 'WebAssembly SIMD support' in chrome://flags or 'javascript.options.wasm_simd' in about:config for Firefox");
    }

    allocateMatrices(n) {
        const align = 16;
        const bytes_per_page = 65536;
        const bytes_per_matrix = 4 * n * n + align; // why a padding here is needed?

        var ptrs = []
        var last_alloc = this.linear_mem_start;
        for (var i = 0; i < 3; ++i) {
            var rem = last_alloc % align;
            var ptr = rem > 0 ? last_alloc + (align - rem) : last_alloc;
            last_alloc = ptr + bytes_per_matrix; 
            ptrs.push(ptr);
        }

        const mem_needed = last_alloc - bytes_per_page * this.pages_allocated;
        if (mem_needed > 0) {
            const additional_pages = Math.ceil(mem_needed / bytes_per_page);
            this.wasm.memory.grow(additional_pages);
            this.pages_allocated += additional_pages;

            var matrices = [];
            for (var i = 0; i < 3; ++i) {
                matrices.push(new Float32Array(
                    this.wasm.memory.buffer,
                    ptrs[i],
                    n * n
                ));
            }

            for (var i = 0; i < n; ++i) {
                for (var j = 0; j < n; ++j) {
                    const index = i * n + j;
                    matrices[0][index] = (i * j + 1) / n;
                    matrices[1][index] = (i * (j + 1)) / n;
                    matrices[2][index] = (i * (j + 2)) / n;
                }
            }
        }

        return ptrs;
    }

    gemm(n) {
        const alpha = 1.5;
        const beta = 1.2;
        const n2 = n * n;

        const ptrs = this.allocateMatrices(n);

        const start = performance.now();
        this.wasm.gemm(
            n, alpha, beta,
            ptrs[0], n2,
            ptrs[1], n2,
            ptrs[2], n2
        );
        const end = performance.now();

        return end - start;
    }

    symm(n) {
        const alpha = 1.5;
        const beta = 1.2;
        const n2 = n * n;

        const ptrs = this.allocateMatrices(n);

        const start = performance.now();
        this.wasm.symm(
            n, alpha, beta,
            ptrs[0], n2,
            ptrs[1], n2,
            ptrs[2], n2
        );
        const end = performance.now();

        return end - start;
    }
}

const benchmarks = [
    new WasmBenchmark(polybench_slow),
    new WasmBenchmark(polybench_fast)
];

const gemm_button = document.getElementById("gemm");
const symm_button = document.getElementById("symm");

gemm_button.addEventListener("click", _ => {
    const n = 800;
    benchmarks.forEach(b => {
        b.init().then(_ => {
            const time = b.gemm(n);
            console.log(time);
        })
        .catch(e => alert(e));
    });
});

symm_button.addEventListener("click", _ => {
    const n = 800;
    benchmarks.forEach(b => {
        b.init().then(_ => {
            const time = b.symm(n);
            console.log(time);
        })
        .catch(e => alert(e));
    });
});